// jsx => vnode
// createElement 生成vnode
// vnode 是一个对象 包含 type，props，children等值。注意：传入children 每行babel都会调用createElement，从而实现递归

function createElement(type, props, ...children) {
    delete props.__source;
    delete props.__self;

    return {
        type,
        ...props,
        children
    }

    console.log(type, props, children);
}

export default {
    createElement
}
